const base_url = 'http://128.199.5.111/api';

export const server_calls = {
    
    items: async () => {
        const response = await fetch(`${base_url}/item/all`);
        let data = await response;
        return data;
    },

    nexomon: async () => {
        const response = await fetch(`${base_url}/nexomon/all`);
        let data = await response.json();
        return data;
    },

    status: async () => {
        const response = await fetch(`${base_url}/statusEffect/all`);
        let data = await response.json();
        return data;
    },

    type: async () => {
        const response = await fetch(`${base_url}/typeEffectivess/all`);
        let data = await response.json();
        return data;
    },

    vaults: async () => {
        const response = await fetch(`${base_url}/vault/all`);
        let data = await response.json();
        return data;
    },

    keys: async () => {
        const response = await fetch(`${base_url}/key/all`);
        let data = await response.json();
        return data;    
    },

    signin: async (email, password) => {
        const response = await fetch('https://ct-nexopedia-adamschellenberg.herokuapp.com/signin', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                email: email,
                password: password
            })
        });

        if (!response.ok) {
            throw new Error ('Failed to login')
        };
        let data = await response.json()
        console.log ('Token: ', data.token);
        return alert('Successfully signed in!');
    },

    signup: async (email, password) => {
        const response = await fetch('https://ct-nexopedia-adamschellenberg.herokuapp.com/signup', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                email: email,
                password: password
            })
        });

        if (!response.ok) {
            throw new Error ('Failed to create new account')
        };
        server_calls.signin(email, password);
        let data = await response.json()
        console.log('Response: ', data.success);

        return alert('Successfully created an account!');
    },

    logout: () => {

    }
}
